import React ,{useState, useEffect} from 'react';
import {
  ChakraProvider,
  Box,
  theme,
  Tabs,
  TabList,
  TabPanels,
  Tab,
  TabPanel,
} from '@chakra-ui/react';
import Header from './components/header'
import Prototype_Single from './components/prototype_single_page';
import Prototype from './components/prototype';


function App() {

  const [width, setWidth] = useState();

  useEffect(() => {
    setWidth(window.innerWidth)
  })
  return (
    <ChakraProvider theme={theme}>
      <Header w="100%"/>
      <Box w="100%">
        <Tabs >
          <TabList mb="1em">
            <Tab>KLIA</Tab>
            <Tab>klia2</Tab>
          </TabList>
          <TabPanels>
            <TabPanel>
              {width > '768px' ? <Prototype_Single /> : <Prototype />}
            </TabPanel>
            <TabPanel>
            {width > '768px' ? <Prototype_Single /> : <Prototype />}
            </TabPanel>
          </TabPanels>
        </Tabs>
      </Box>
    </ChakraProvider>
  );
}

export default App;
